void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.x;
    float f = 50.0;
    float t = iTime * .150;
    float e = 0.123;
    float i = 7.7123;
    uv.x += t + sin(uv.y*i)*e;
    uv.y += t - cos(uv.x*i)*e;
    float g = 100.0;
    float k = sin(uv.x * g) * tan(uv.y*g) * f;
    fragColor = vec4(k);
}
